import './carts.css';
import Cartitem from './cartitem/Cartitem';

const data = [
    { heading: "Samsung Galaxy", price: '$399.99', button: 'Remove' },
    { heading: "Google Pixel", price: '$499.99', button: 'Remove' },
    { heading: "Xiaomi Redmi Note 2", price: '$699.99', button: 'Remove' }
]

function Carts(props) {
    return(
        <div>
            <table border={1}  style={{margin:'auto'}} cellPadding="8" cellSpacing={'8'}>
                <thead>
                    <tr>
                        <th>Heading</th>
                        <th>Price</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                {data.map(function(cartitem){
                    return <Cartitem />
                })}
                {/* {data.map(function (cartitem,i) {
                    return <cartItem data={item} key={i} />
                })} */}

                {/* <Cartitem heading = "Samsung Galaxy" price = '$399.99'/>
                <Cartitem  heading = "Google Pixel" price = '$499.99'/>
                <Cartitem  heading = "Xiaomi Redmi Note 2" price = '$699.99'/> */}
                       
            </table>
        </div>
    )
}
export default Carts;
